    <style type="text/css">
      @font-face {
        font-family: "page_section_font";
        src: url("webfonts/open-sans/OpenSans-Regular.ttf") format("truetype");
      }

      @font-face {
        font-family: "SFUITextRegular";
        font-style: normal;
        font-weight: normal;
        src: url("webfonts/sfuitext/sf-ui-text-regular-58646b56a688c.woff")
          format("woff");
      }

      @font-face {
        font-family: "SFUITextLight";
        font-style: normal;
        font-weight: normal;
        src: url("webfonts/sfuitext/sf-ui-text-light-5864714f67240.woff")
          format("woff");
      }

      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
        font-family: sans-serif;
      }

      body {
        color: #404349;
        font-family: sans-serif;
        -webkit-font-smoothing: antialiased;
      }

      body,
      html {
        height: 100%;
        margin: 0;
        font-size: 14px;
      }

      a {
        text-decoration: none;
        font-family: sans-serif;
      }

      a:active {
        color: #2d6bb3;
      }

      a:hover {
        color: #6aace6;
      }

      #frame {
        width: 100%;
        height: auto;
        margin: 0px;
        float: left;
        position: relative;
        top: 0px;
        background-color: #fff;
        font-size: 14px;
        color: #444;
        clear: both;
        z-index: 10;
        //box-shadow:0px 1px 2px #777;
      }

      #inner-frame {
        max-width: 1200px;
        width: 98%;
        height: auto;
        margin: auto;
        /* margin-bottom: 2%; */
        margin-top: 2%;
        /* padding: 10px; */
        position: relative;
        overflow-x: hidden;
      }

      input:-internal-autofill-selected {
        background-color: transparent;
      }

      .text {
        font-family: sans-serif;
        font-variant: tabular-nums;
        list-style: none;
        position: relative;
        display: inline-block;
        width: 100%;
        font-size: 1.3rem;
        line-height: 1.5;
        color: #29343d;
        background-image: none;
        border-radius: 4px;
        transition: all 0.3s;
        background-color: transparent;
        border: none;
        padding: 6px 12px 6px;
        height: 45 px;
      }

      .input_icon_holder {
        position: relative;
        margin-bottom: 5%;
      }

      .input_icon2 {
        display: table-cell;
        padding: 6px 15px;
        font-size: 14px;
        font-weight: 400;
        line-height: 1;
        color: #006097;
        text-align: center;
        border: 1px solid #ccc;
        width: 1%;
        white-space: nowrap;
        vertical-align: middle;
        font-family: SFUITextRegular;
        background-color: #fefefe;
        cursor: pointer;
      }

      #label {
        padding: 5px;
        position: absolute;
        right: 10px;
        top: 10px;
        z-index: 10;
        width: auto;
        font-size: 14px;
        font-weight: 600;
        color: #006097;
        text-align: center;
        border: none;
        vertical-align: middle;
        //font-family: SFUITextRegular;
        background-color: #fff;
      }

      #label:hover {
        background-color: #f2f2f2;
      }

      .input_icon_holder2 {
        position: relative;
        display: table;
        border-collapse: separate;
        margin-top: 5px;
        border: 1px solid #333;
        border-radius: 4px;
        color: #333;
      }

      .errorfound {
        border: 2px solid #d00;
        box-shadow: 0px 0px 1px #d00;
        color: #d00;
      }

      .inv_btn {
        background-color: #0a66c2;
        padding: 15px 20px;
        margin-left: 10px;
        border: none;
        color: #fff;
        font-size: 14px;
        font-family: page_title_font;
        cursor: pointer;
        height: 52px;
        border-radius: 5px;
      }

      .inv_btn_i {
        background-color: #0a66c2;
      }

      .inv_btn_i:hover {
        background-color: #0073b1;
      }

      #form_layout {
        display: none;
        position: relative;
        max-width: 353px;
        width: 100%;
        margin: auto;
        height: auto;
        background-color: rgba(255, 255, 255, 0.1);
        color: #fff;
        text-align: left;
        //padding:7px;
        margin-top: 30px;
        margin-bottom: 0;
        font-size: 12px;
        //box-shadow:-1px 18px 3px 0px #333;
      }

      a:visited {
        color: #665ed0;
      }
      a:visited {
        color: #0073b1;
      }
      a {
        text-decoration: none;
        font-weight: bold;
        background-color: transparent;
        border: 0;
        color: #0073b1;
      }
      a {
        margin: 0;
        padding: 0;
        font-size: 100%;
        vertical-align: baseline;
        background: transparent;
      }

      @keyframes reduce {
        from {
          font-size: 16px;
          height: 100%;
          top: 0;
        }
        to {
          font-size: 12px;
          height: 30%;
          top: -10px;
        }
      }

      @keyframes increase {
        from {
          font-size: 12px;
          height: 30%;
          top: -10px;
        }
        to {
          font-size: 16px;
          height: 100%;
          top: 0;
        }
      }
    </style>
